  <>
    <Auth0Provider
      domain="dev-c7k10q347wf61ym5.us.auth0.com"
      clientId="oxLskA2XwTMuKyofNT6mu9EhzxaAv8pt"
      authorizationParams={{
        redirect_uri: window.location.origin
